import React from 'react';
import './Techstack.css';

const Techstack = () => {
  const techs = [
    {
      name: "HTML5",
      icon: "汳ｻ",
      color: "#E34F26"
    },
    {
      name: "CSS3",
      icon: "沁ｨ",
      color: "#1572B6"
    },
    {
      name: "JavaScript",
      icon: "笞｡",
      color: "#F7DF1E"
    },
    {
      name: "React",
      icon: "笞幢ｸ十

#61DAFB"
    },
    {
      name: "Node.js",
      icon: "沺｢",
      color: "#339933"
    },
    {
      name: "Python",
      icon: "汾構

#F05032"
    },
    {
      name: "Bootstrap",
      icon: "沁ｯ",
      color: "#7952B3"
    },
    {
      name: "Express.js",
      icon: "泅",
      color: "#000000"
    },
    {
      name: "MySQL",
      icon: "汾ｬ",
      color: "#4479A1"
    },
    {
      name: "AWS",
      icon: "笘ｸ十

#FF9900"
    }
  ];

  return (
    <div className="techstack-container">
      <div className="techstack-grid">
        {techs.map((tech, index) => (
          <div 
            key={index} 
            className="tech-item"
            style={{ '--tech-color': tech.color }}
          >
            <div className="tech-icon">{tech.icon}</div>
            <div className="tech-name">{tech.name}</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Techstack;
